import{_ as a,a as r,b as i,c as l}from"./chunks/FMU_Debug_Port_Horizontal.CZlcrhnb.js";import{_ as t,c as o,a8 as s,o as n}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro Pix32 v5","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/holybro_pix32_v5.md","filePath":"uk/flight_controller/holybro_pix32_v5.md"}'),h={name:"uk/flight_controller/holybro_pix32_v5.md"};function p(d,e,u,c,m,f){return n(),o("div",null,e[0]||(e[0]=[s('<h1 id="holybro-pix32-v5" tabindex="-1">Holybro Pix32 v5 <a class="header-anchor" href="#holybro-pix32-v5" aria-label="Permalink to &quot;Holybro Pix32 v5&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Pix32 v5</a><sup>®</sup> is an advanced autopilot flight controller designed and made by Holybro<sup>®</sup>. Він оптимізований для роботи з прошивкою PX4, яка призначена як для академічних, так і для комерційних розробників. It is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design and runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS. Це можна вважати варіантом версії Pixhawk4.</p><p>Pix32 v5 розроблено для пілотів, які потребують потужності, гнучкої та настроюваної системи керування польотами. Він складається з окремого контролера польоту та базової плати, які з&#39;єднані 100-контактним роз&#39;ємом. Цей дизайн дозволяє користувачам вибирати базову плату від Holybro або налаштовувати свою власну.</p><p><img src="'+a+'" alt="Pix32 v5 Family"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="короткии-опис" tabindex="-1">Короткий опис <a class="header-anchor" href="#короткии-опис" aria-label="Permalink to &quot;Короткий опис&quot;">​</a></h2><ul><li>Головний FMU процесор: STM32F765 <ul><li>32 Bit Arm® Cortex®-M7, 216MHz, 2MB memory, 512KB RAM</li></ul></li><li>IO Processor: STM32F100 <ul><li>32 Bit Arm®️ Cortex®️-M3, 24MHz, 8KB SRAM</li></ul></li><li>Бортові сенсори: <ul><li>Акселератор/гіроскоп: ICM-20689</li><li>Accel/Gyro: BMI055 або ICM20602</li><li>Магнітометр: IST8310</li><li>Барометр: MS5611</li></ul></li><li>GPS: u-blox Neo-M8N GPS/ГЛОНАСС приймач; інтегрований магнетометр IST8310</li><li>Інтерфейси: <ul><li>8-16 PWM виходи (8 із IO, 8 із FMU)</li><li>3 виділених PWM/Capture входи на FMU</li><li>Виділений R/C вхід для CPPM</li><li>Виділений R/C вхід для Spektrum / DSM та S.Bus з аналоговим / PWM RSSI входом</li><li>Спеціалізований S.BUS вивід сервоприводу</li><li>5 загальних послідовних портів <ul><li>2 з повним контролем потоку</li><li>1 з відокремленням 1.5A поточної межі</li></ul></li><li>3 I2C порти</li><li>4 шини SPI <ul><li>1 внутрішня шина датчика високої швидкості SPI з 4 обраними чіпами і 6 DRDY</li><li>1 внутрішня SPI шина, виділена для</li><li>Барометр з 2-ма чіпами, не DRDY</li><li>1 внутрішній SPI bus, виділений для FRAM</li><li>Підтримує спеціалізовану SPI калібрування EEPROM, розташовану на модулі сенсорів</li><li>1 зовнішній bus SPI</li></ul></li><li>До 2 CANBus для подвійного CAN з послідовним ESC <ul><li>Кожен CANBus має окреме керування тихим контролером або ESC RX-MUX</li><li>Аналогові входи для напруги / струму з 2 батарей</li><li>2 додаткових аналогових входи</li></ul></li></ul></li><li>Електрична система: <ul><li>Вивід енергомодуля 4.9~5.5 В</li><li>Максимальна вхідна напруга: 6 В</li><li>Максимальний струм у значенні: 120 A</li><li>Вхід USB Power: 4.75~5.25V</li><li>Вхід сервоприводу: 0~36V</li></ul></li><li>Вага та розміри: <ul><li>Розміри: 45x45x13.5мм</li><li>Вага: 33.0гр</li></ul></li><li>Environmental Data, Quality &amp; Reliability: <ul><li>Температура роботи: -40 ~ 85°c</li><li>Температура зберігання: -40 / 85℃</li><li>CE</li><li>FCC</li><li>Сумісний із RoHS (без свинцю)</li></ul></li></ul><p>Additional information can be found in the <a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 V5 Technical Data Sheet</a>.</p><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Order from <a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Holybro website</a>.</p><h2 id="зборка-інсталяція" tabindex="-1">Зборка/інсталяція <a class="header-anchor" href="#зборка-інсталяція" aria-label="Permalink to &quot;Зборка/інсталяція&quot;">​</a></h2><p>The <a href="./../assembly/quick_start_holybro_pix32_v5.html">Pix32 v5 Wiring Quick Start</a> provides instructions on how to assemble required/important peripherals including GPS, Power Management Board etc.</p><h2 id="макети-базовоі-плати" tabindex="-1">Макети базової плати <a class="header-anchor" href="#макети-базовоі-плати" aria-label="Permalink to &quot;Макети базової плати&quot;">​</a></h2><p><img src="'+r+'" alt="Pix32 v5 Image"></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer"><em>pix32 v5</em> and mini baseboard</a></p><h2 id="розміри" tabindex="-1">Розміри <a class="header-anchor" href="#розміри" aria-label="Permalink to &quot;Розміри&quot;">​</a></h2><p><img src="'+i+'" alt="Pix32 v5 Image"></p><h2 id="номінальна-напруга" tabindex="-1">Номінальна напруга <a class="header-anchor" href="#номінальна-напруга" aria-label="Permalink to &quot;Номінальна напруга&quot;">​</a></h2><p><em>Pix32 v5</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWER1</strong>, <strong>POWER2</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>За таких умов всі джерела живлення будуть використовуватися в цьому порядку для живлення системи:</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.9V to 5.5V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>За таких умов система не буде витрачати жодної потужності (не буде працювати), але залишиться неушкодженою.</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (operational range 4.1V to 5.7V, 0V to 10V undamaged)</li><li><strong>USB</strong> input (operational range 4.1V to 5.7V, 0V to 6V undamaged)</li><li>Servo input: VDD_SERVO pin of <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 42V undamaged)</li></ol><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>зробіть holybro_durandal-v1_default</span></span></code></pre></div><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p>The system&#39;s <a href="./../debug/system_console.html">serial console</a> and SWD interface runs on the <strong>FMU Debug</strong> port</p><p><img src="'+l+'" alt="FMU debug port diagram"></p><p>The pinout uses the standard <a href="./../debug/swd_debug.html#pixhawk-debug-mini">Pixhawk Debug Mini</a> interface defined in the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a>.</p><h2 id="периферіині-пристроі" tabindex="-1">Периферійні пристрої <a class="header-anchor" href="#периферіині-пристроі" aria-label="Permalink to &quot;Периферійні пристрої&quot;">​</a></h2><ul><li><a href="./../sensor/airspeed.html">Digital Airspeed Sensor</a></li><li><a href="./../telemetry/">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="підтримувані-платформи-конструкціі" tabindex="-1">Підтримувані платформи / Конструкції <a class="header-anchor" href="#підтримувані-платформи-конструкціі" aria-label="Permalink to &quot;Підтримувані платформи / Конструкції&quot;">​</a></h2><p>Будь-який мультикоптер / літак / наземна платформа / човен, який може керуватися звичайними RC сервоприводами або сервоприводами Futaba S-Bus. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><ul><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 v5 Technical Data Sheet</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer">Pix32 v5 Pinouts</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-BASE-Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Base Board Schematic Diagram</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-Base-Mini-Board_Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Mini Base Board Schematic Diagram</a></li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a>.</li></ul>',42)]))}const _=t(h,[["render",p]]);export{P as __pageData,_ as default};
